    //{"Text":"You don't have the edit permission or member permission to the SharePoint site, please contact the site owner or site admin.","convertText":[{"LangCode":"es","Text":"No tiene el permiso de edición o el permiso de miembro para el sitio de SharePoint, póngase en contacto con el propietario del sitio o el administrador del sitio."},{"LangCode":"pt","Text":"Você não tem permissão de edição ou permissão de membro para o site SharePoint, entre em contato com o proprietário do site ou administrador do site."},{"LangCode":"ru","Text":"У вас нет разрешения на редактирование или разрешения участника сайта SharePoint, обратитесь к владельцу сайта или администратору сайта."},{"LangCode":"ja","Text":"SharePoint サイトに対する編集権限またはメンバー権限を持っていない場合は、サイト所有者またはサイト管理者にお問い合わせください。"},{"LangCode":"fr","Text":"Vous n’avez pas l’autorisation de modification ou l’autorisation de membre sur le site SharePoint, veuillez contacter le propriétaire du site ou l’administrateur du site."},{"LangCode":"de","Text":"Sie verfügen nicht über die Bearbeitungsberechtigung oder die Mitgliederberechtigung für die SharePoint-Website, wenden Sie sich an den Websitebesitzer oder Websiteadministrator."},{"LangCode":"it","Text":"Non si dispone dell'autorizzazione di modifica o dell'autorizzazione membro per il sito di SharePoint, contattare il proprietario del sito o l'amministratore del sito."},{"LangCode":"pl","Text":"Nie masz uprawnień do edycji ani uprawnień członka do witryny programu SharePoint, skontaktuj się z właścicielem witryny lub administratorem witryny."},{"LangCode":"uk","Text":"У вас немає дозволу на редагування або дозволу учасника на сайт SharePoint, зверніться до власника сайту або адміністратора сайту."},{"LangCode":"nl","Text":"U hebt geen bewerkingsmachtiging of lidmachtiging voor de SharePoint-site, neem contact op met de site-eigenaar of sitebeheerder."},{"LangCode":"hu","Text":"Ha nem rendelkezik szerkesztési engedéllyel vagy tagi engedéllyel a SharePoint-webhelyhez, kérjük, lépjen kapcsolatba a webhely tulajdonosával vagy a webhely rendszergazdájával."},{"LangCode":"cs","Text":"Nemáte oprávnění k úpravám ani oprávnění člena k webu služby SharePoint, obraťte se na vlastníka webu nebo správce webu."}],"Key":"s"},
    
